  true,\n\t\"url\": null,\n\t\"notes\": \"Global Earthquake Hazard Frequency and Distribution
  is a 2.5 by 2.5 minute global utilizing Advanced National Seismic System (ANSS)
  Earthquake Catalog nndata of actual earthquake events exceeding 4.5 on the Richter
  scale during the time period 1976 through 2002. To produce the final output, the
  frequency of an earthquake hazard is nncalculated for each grid cell, and the resulting
  grid cells are then classified into deciles (10 classes consisting of an approxiamately
  equal number of grid cells). The greater the grid nncell value in the final output,
  the higher the relative frequency of hazard posed by earthquakes. This dataset is
  the result of collaboration among the Columbia University Center for nnHazards and
  Risk Research (CHRR) and Columbia University Center for International Earth Science
  Information Network (CIESIN).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
